import axios from 'axios';

export const createFakeUser = async () => {
  try {
    const response = await axios.post('/api/create-fake-user');
    return response.data;
  } catch (error) {
    console.error('Error creating fake user:', error);
    return null;
  }
};

export const loginAsFakeUser = (setUser) => {
  createFakeUser().then(fakeUser => {
    if (fakeUser) {
      setUser(fakeUser);
    }
  });
};
